syntax = "proto3";

package io.seata.protocol.protobuf;

import "AbstractIdentifyRequest.proto";

option java_multiple_files = true;
option java_outer_classname = "RegisterTMRequest";
option java_package = "io.seata.protocol.protobuf";

// PublishRequest is a publish request.
message RegisterTMRequest {
    AbstractIdentifyRequest abstractIdentifyRequest = 1;
}